pragma solidity >=0.7.0 <0.9.0;
contract BusinessConsensus{
    // This declares a new complex type which will
    // be used for variables later.
    // It will represent a single voter.
    struct Voter {
        bool voted;  // if true, that person already voted
        bool vote;   //represents approval or disapproval
        address recipient; // represents a stakeholder recipient
    }
    // This is a type for a single proposal.
    struct Proposal {
        uint voteCount; // number of accumulated votes
        bytes32 messageID; // message ID of proposal
        uint256 BusinessRequirement;
        address contractAddress;
        address initiator;
        uint256 expiryDate; //expiry Date
        uint256 AccumulatedPercentage;
        uint256 numApprovals;
        uint256 numberCompiled;
        bytes32 finalVerdict;
    }
 

    address[] public keys;

    Voter[] public voters;

    mapping(address => Voter) public voters_map;

    // A struct for relevant info of the business proposal at hand
    Proposal public proposal;

    constructor(bytes32 _messageID, uint expiry, uint requiredPercentage) {
        // initialize proposal set by the original sender and counted votes to zero
        proposal = Proposal({
                voteCount: 0,
                messageID: _messageID,
                initiator : msg.sender,
                expiryDate : block.timestamp + expiry,
                BusinessRequirement : requiredPercentage,
                AccumulatedPercentage : 0,
                numApprovals : 0,
                numberCompiled : 0,
                finalVerdict : "Rejected",
                contractAddress : address(this)
            });
    }
    function getValues() external view returns (bytes32){
        return proposal.messageID;
    }
    function getParameters() external view returns (bytes32, uint , address ,uint ,uint){
        return (proposal.messageID,proposal.expiryDate,proposal.initiator,proposal.BusinessRequirement,proposal.numApprovals);
    }
    function getParameters2(address test_address) external view returns (bool, bool, address){
        return (voters_map[test_address].vote, voters_map[test_address].voted, voters_map[test_address].recipient);
    }
    // Give `voter` the right to vote in this proposal.
    // May only be called by `initiator`.
    function RegisterVoter(address voter) external {
        // only initiator can register a recipient in the voting process
        require(
            msg.sender == proposal.initiator,
            "Only initiator can register a recipient."
        );
        require(voter != proposal.initiator, "Initiator can't vote!");

        require(voters_map[voter].recipient == address(0), "Recipient is already registered");

        require(block.timestamp < proposal.expiryDate, "Proposal has reached its expiry date");

        Voter memory x = Voter({voted: false,recipient: voter, vote: false});
        voters_map[voter] = x;
        keys.push(voter);
    }

    function Vote(string memory response) external {

        require(block.timestamp < proposal.expiryDate, "Voting has expired");
        require(voters_map[msg.sender].recipient != address(0x0), "You are not registered to vote");
        require(!voters_map[msg.sender].voted, "You already sent a response.");

        if(keccak256(bytes(response)) == keccak256(bytes("i approve"))){
            voters_map[msg.sender].voted = true;
            voters_map[msg.sender].vote = true;
            proposal.numApprovals += 1;
            proposal.voteCount += 1;
            voters.push(voters_map[msg.sender]);
        }

        else if(keccak256(bytes(response)) == keccak256(bytes("i disapprove"))){
            voters_map[msg.sender].voted = true;
            proposal.voteCount += 1;
            voters.push(voters_map[msg.sender]);
        }
        //if given invalid response, it will be considered a disapproval
        else{
            voters_map[msg.sender].voted = true;
            proposal.voteCount += 1;
            voters.push(voters_map[msg.sender]);
        }
        
    }

    /// compile all relevant information into a Bundle
    function Consensus() external {
        require(block.timestamp >= proposal.expiryDate, "Verdict has not been reached yet");
        require(proposal.numberCompiled == 0, "Consensus has already been calculated");
        require(msg.sender == proposal.initiator || voters_map[msg.sender].recipient != address(0x0), "You aren't authorize to compile Bundle");
        proposal.AccumulatedPercentage = (proposal.numApprovals/keys.length)*100;
        if(proposal.AccumulatedPercentage >= proposal.BusinessRequirement){
            proposal.finalVerdict = "Accepted";
        }
        for(uint8 i=0; i< keys.length; i++){
            if(voters_map[keys[i]].voted == false){
                voters.push(voters_map[keys[i]]);
            }
        }
        proposal.numberCompiled += 1;
    }

    function retrieve_bundle() external view returns (Proposal memory, Voter[] memory){
        require(block.timestamp >= proposal.expiryDate, "Verdict has not been reached yet");
        return (proposal,voters);
        
    }

}

